class AllLichHenResponse {  List<LichHenDetail>? dataProvider;  num? count;  num? itemPerPage;  String? currentPage;  num? pages;  AllLichHenResponse({this.dataProvider, this.count, this.itemPerPage, this.currentPage, this.pages});  AllLichHenResponse.fromJson(Map<String, dynamic> json) {    if (json['dataProvider'] != null) {      dataProvider = <LichHenDetail>[];      json['dataProvider'].forEach((v) {        dataProvider!.add(LichHenDetail.fromJson(v));      });    }    count = json['count'];    itemPerPage = json['itemPerPage'];    currentPage = json['currentPage'];    pages = json['pages'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = <String, dynamic>{};    if (dataProvider != null) {      data['dataProvider'] = dataProvider!.map((v) => v.toJson()).toList();    }    data['count'] = count;    data['itemPerPage'] = itemPerPage;    data['currentPage'] = currentPage;    data['pages'] = pages;    return data;  }}class LichHenDetail {  num? id;  String? ten;  String? mota;  num? nguoiphutrachId;  String? lanhdaophutrach;  // Updated to match API response  String? ngayketthuc;      // Added field  String? ngaybatdau;  String? nguoitao;         // Added field  String? nguoiduyet;       // Added field  LichHenDetail(      {this.id,        this.ten,        this.mota,        this.nguoiphutrachId,        this.lanhdaophutrach,        this.ngayketthuc,        this.ngaybatdau,        this.nguoitao,        this.nguoiduyet});  LichHenDetail.fromJson(Map<String, dynamic> json) {    id = json['id'];    ten = json['ten'];    mota = json['mota'];    nguoiphutrachId = json['nguoiphutrach_id'];    lanhdaophutrach = json['lanhdaophutrach'];  // Updated to match API response    ngayketthuc = json['ngayketthuc'];          // Deserialize added field    ngaybatdau = json['ngaybatdau'];    nguoitao = json['nguoitao'];                // Deserialize added field    nguoiduyet = json['nguoiduyet'];            // Deserialize added field  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = Map<String, dynamic>();    data['id'] = this.id;    data['ten'] = this.ten;    data['mota'] = this.mota;    data['nguoiphutrach_id'] = this.nguoiphutrachId;    data['lanhdaophutrach'] = this.lanhdaophutrach;  // Updated to match API response    data['ngayketthuc'] = this.ngayketthuc;          // Serialize added field    data['ngaybatdau'] = this.ngaybatdau;    data['nguoitao'] = this.nguoitao;                // Serialize added field    data['nguoiduyet'] = this.nguoiduyet;            // Serialize added field    return data;  }}